	(4590,3250,'it','Fragole in polvere 40% (fragole, maltodestrina, acidificante: E 331), amido modificato, YOGURT in polvere magro, maltodestrina, zucchero, sale da cucina iodato, estratto di lievito, pepe nero, aceto balsamico essiccato, menta.'),
