	(4598,3257,'de','Maltodextrin, WEIZENmehl, Pilze getrocknet und Pilzextrakt 14% (Champignons, Butterpilze), Tomatenpulver, modifizierte Maisstärke, jodiertes Kochsalz, Geschmacksverstärker: Mononatriumglutamat, getrocknete  Zwiebeln, Kartoffelstärke, Aromen (enthält SOJA), Hefeextrakt, Zucker, Rapsöl, Gewürze, Petersilie getrocknet.'),
	(4599,3257,'fr','Maltodextrine, farine de BLÉ, champignons séchés et extrait de champignons 14% (champignons de Paris, bolets jaunes), tomates en poudre, amidon modifié de maïs, sel de cuisine iodé, exhausteur de goût: glutamate monosodique, oignons déshydratés, fécule de pommes de terre, arômes (contient SOJA), extrait de levure, sucre, huile de colza, épices, persil séché.'),
	(4600,3257,'it','Maltodestrina, farina di FRUMENTO, funghi secchi ed estratto di funghi 14% (funghi prataioli, boleti gialli), pomodoro in polvere, amido modificato di granoturco, sale da cucina iodato, esaltatore di sapidità: glutammato monosodico, cipolle disidratate, fecola di patate, aromi (contiene SOIA), estratto di lievito, zucchero, olio di colza, spezie, prezzemolo essiccato.'),
	(4601,3263,'de','Kochsalz jodiert, Glukosesirup getrocknet, Geschmacksverstärker (Mononatriumglutamat, E 635), Würze (SOJA), Palmfett, Hefeextrakt, Gewürze, Gemüsepulver 0.3% (Lauch, Zwiebeln, Karotten), Aromen, SELLERIE-Extrakt.'),
	(4602,3263,'fr','Sel de cuisine iodé, sirop de glucose déshydraté, exhausteurs de goût (glutamate monosodique, E 635), condiment (SOJA), graisse de palme, extrait de levure, épices, poudre de légumes 0.3% (poireau, oignons, carottes), arômes, extrait de CÉLERI.'),
	(4603,3263,'it','Sale da cucina iodata, sciroppo di glucosio disidratato, esaltatori di sapidità (glutammato monosodico, E 635), condimento (SOIA), grasso di palma, estratto di lievito, spezie, verdure in polvere 0.3% (porro, cipolle, carote), aromi, estratto di SEDANO.'),
	(4604,3263,'de','Kochsalz jodiert, Glukosesirup getrocknet, Geschmacksverstärker (Mononatriumglutamat, E 635), Würze (Soja), Palmfett, Hefeextrakt, Gewürze, Gemüsepulver 0.3% (Lauch, Zwiebeln, Karotten), Aromen, Sellerie-Extrakt.\n\nKann enthalten: Gluten.'),
	(4605,3264,'de','Zutaten: 26% Gewürze (13% Paprika¹, Knoblauch¹, Zwiebeln¹, Cayennepfeffer, Koriander, schwarzer Pfeffer), jodiertes Speisesalz, WEIZENMEHL, Zucker, Hefeextrakt, EIWEISSPULVER, 4% Kräuter (Thymian, Majoran, Rosmarin), Tomatenpulver¹, Aromen, Palmöl, Zitronensaftpulver. ¹Aus nachhaltigem Anbau. Kann Spuren von Milch, Sellerie und Senf enthalten.');
